        [Benchmark]
        public void ShellSort() => shellSort.Sort(Copy(data));

        private static int[] Copy(int[] input)
        {
            var copy = new int[input.Length];
            System.Buffer.BlockCopy(input, 0, copy, 0, input.Length *  sizeof(int));

            return copy;
        }
